import React from 'react';
import { MobileIcon, Nav, NavbarContainer, NavItem, NavLinks, NavMenu } from './navbarElements';

const Navbar = () => {
    return (
        <>
            <Nav>
                <NavbarContainer>
                    <h1>hello</h1>
                </NavbarContainer>
                <MobileIcon>
                    <FaBars />
                </MobileIcon>
                <NavMenu>
                    <NavItem>
                        <NavLinks to="about">About</NavLinks>
                    </NavItem>
                </NavMenu>
            </Nav>
        </>
    )
}

export default Navbar;
